import React from "react";
import '../css/section3.css'

class Section3 extends React.Component{
    render(){
        return(
            <section className="Section3">
                <header className="Section3-heading">
                    <h1 className="Section3-h1">Этапы обучения</h1>
                </header>
                <article className="Section3-info">
                    <div className="Section3-stagesOfTraining">
                        <span className="title">
                            Первое знакомство
                        </span>
                        <img src="" alt="Первое знакомство" className="Section3-pic"/>
                        <p>На первом бесплатном занятии, ученик знакомится с педагогом, проходит диагностику знаний, разбирает задания, закрепляет на практике. Выбирают материал для изучения.</p>
                    </div>
                </article>
            </section>
        )
    }
}

export default Section3;
